message:
Considerando...

1- que o PR estava ausente de BSB, em local seguro, Araraquara, sob a proteção de seu "cumpanheiro" Edinho Silva (Lula supostamente teria ido se solidarizar com vítimas de enchentes, 6 vítimas apenas...");

2- que há 72 horas foram rastreadas novas caravanas de vários pontos do país se deslocando para BSB;

3- que, mesmo com esses informes, o policiamento da praça dos 3 poderes não foi reforçado e que as forças policiais estranhamente demoraram a reagir aos invasores;

4- que as polícias legislativa e do STF, apesar de muito bem armadas e equipadas não esboçaram qualquer reação, o que certamente teria provocado vítimas;

5- que os manifestantes que estavam há mais de 60 dias em frente ao QG em nenhum momento praticaram qualquer ato criminoso;

6- que os grupos recém chegados à Brasilia, segundo testemunhas, convocaram e insuflaram aqueles patriotas a uma grande manifestação na praça dos 3 Poderes, sem revelar suas verdadeiras intenções;

7- que os estudos de psicologia das multidões revelam o conhecido "efeito manada" onde as adesões de última hora são incontroláveis;

8- que a história registra inúmeros fatos onde massas foram conduzidas por infiltrados;

9- que é princípio elementar a premissa "a quem interessa o crime ?"

Resta-nos, então, forçosamente, concluir que os episódios do dia 08/01/2023 foram ardilosamente preparados e executados com eficiência pelos esquerdopatas.
